proxy-providers:
  tannel:
    type: http
    url: "https://psub.xpsub.fun/sub?target=clash&&insert=false&emoji=true&list=false&tfo=false&scv=true&fdn=false&sort=false&udp=true&new_name=true"
    interval: 86400
    path: ./tannel.yaml
    exclude-filter: "北京时间|剩余流量|过期时间|网站地址"
    proxy: DIRECT
    health-check:
      enable: true
      url: https://www.google.com/generate_204
      interval: 300    

      
# 全局配置
port: 7890
socks-port: 7891
redir-port: 7892
mixed-port: 7893
tproxy-port: 7894
allow-lan: true    # 允许局域网
bind-address: "*"    # 绑定地址，仅允许其他设备通过这个地址访问
mode: Rule
log-level: info
ipv6: false
unified-delay: true    # 统一延迟
tcp-concurrent: true    # tcp并发
find-process-mode: off    # 控制是否让 Clash 去匹配进程
global-client-fingerprint: chrome    # 伪装指纹
# 移动设备省电
keep-alive-idle: 600
keep-alive-interval: 15
disable-keep-alive: false
profile:
  store-selected: true    # 储存 API 对策略组的选择，以供下次启动时使用
  store-fake-ip: true    # 储存 fakeip 映射表，域名再次发生连接时，使用原有映射地址

# 控制面板  
external-controller: 0.0.0.0:9090    # API控制面板
secret: ""


# 自建节点添加到这里
proxies: 

# 策略组
proxy-groups:
  - name: 🚀 节点选择
    type: select
    proxies:
      - 🇭🇰 香港自动
      - 🇺🇲 美国自动
      - 🌍 其他节点
      - DIRECT
      - ♻️ 自动选择      

  - name: 🇭🇰 香港自动
    type: url-test
    url: http://www.gstatic.com/generate_204
    interval: 300
    tolerance: 50
    use:
      - tannel
    filter: (?i)香港

  - name: 🇺🇲 美国自动
    type: url-test
    url: http://www.gstatic.com/generate_204
    interval: 300
    tolerance: 50
    use:
      - tannel
    filter: (?i)美国

  - name: 🌍 其他节点
    type: select
    use:
      - tannel
    exclude-filter: "香港|美国"

  - name: ♻️ 自动选择
    type: url-test
    url: http://www.gstatic.com/generate_204
    interval: 300
    tolerance: 50
    use:
      - tannel

  - name: 🐟 漏网之鱼
    type: select
    proxies:
      - 🚀 节点选择
      - DIRECT

  - name: 🏡 JNAS
    type: select
    proxies:
      - DIRECT    
      - 🚀 节点选择

  - name: 🤖 AI
    type: select
    proxies:
      - 🇭🇰 香港自动
      - 🇺🇲 美国自动
      - 🌍 其他节点
      - DIRECT

  - name: 🍎 Apple
    type: select
    proxies:
      - 🇭🇰 香港自动
      - 🇺🇲 美国自动
      - 🌍 其他节点
      - DIRECT

  - name: 🪟 Microsoft
    type: select
    proxies:
      - 🇭🇰 香港自动
      - 🇺🇲 美国自动
      - 🌍 其他节点
      - DIRECT

  - name: 🛑 广告拦截
    type: select
    proxies:
      - REJECT
      - DIRECT

rules:
  - SRC-IP-CIDR,192.168.110.211/32,🏡 JNAS
  - DOMAIN-SUFFIX,xn--ngstr-lra8j.com,🚀 节点选择
  - DOMAIN-SUFFIX,services.googleapis.cn,🚀 节点选择
  - RULE-SET,GoogleCNProxyIP,🚀 节点选择
  - RULE-SET,LocalAreaNetwork,DIRECT
  - RULE-SET,custom_ad,🛑 广告拦截
  - RULE-SET,custom_direct,DIRECT
  - RULE-SET,custom_HK,🇭🇰 香港自动
  - RULE-SET,custom_US,🇺🇲 美国自动
  - RULE-SET,whatsApp,🚀 节点选择
  - RULE-SET,ai_domain,🤖 AI
  - RULE-SET,google_domain,🚀 节点选择
  - RULE-SET,youtube_domain,🚀 节点选择
  - RULE-SET,github_domain,🚀 节点选择  
  - RULE-SET,tiktok_domain,🇺🇲 美国自动
  - RULE-SET,telegram_domain,🚀 节点选择
  - RULE-SET,netflix_domain,🇺🇲 美国自动
  - RULE-SET,paypal_domain,🚀 节点选择
  - RULE-SET,gfw_domain,🚀 节点选择
  - RULE-SET,geolocation-!cn_domain,🚀 节点选择
  - RULE-SET,microsoft_domain,🪟 Microsoft
  - RULE-SET,onedrive_domain,🪟 Microsoft
  - RULE-SET,apple_domain,🍎 Apple
  - RULE-SET,google_ip,🚀 节点选择,no-resolve
  - RULE-SET,telegram_ip,🚀 节点选择,no-resolve
  - RULE-SET,netflix_ip,🇺🇲 美国自动,no-resolve
  - RULE-SET,cn_domain,DIRECT
  - RULE-SET,speedtest_domain,DIRECT
  - RULE-SET,cn_ip,DIRECT,no-resolve
  - MATCH,🐟 漏网之鱼

